void doGGA (int number_of_points, double* rho, double* sigma, int functional_id) {
    printf("doGGA(%i)\n", number_of_points);

    xc_func_type funcInternal;
    if (xc_func_init(&funcInternal, functional_id, XC_UNPOLARIZED) != 0) {
        fprintf(stderr, "Functional '%d' not found\n", functional_id);
        return;
    }

    // Ahora reservamos para los arrays
    int mem_size_for_cuda_arrays = sizeof(double) * number_of_points;

    // Alloc for CPU params
    double* vrho = (double*)malloc(mem_size_for_cuda_arrays);
    double* vsigma = (double*)malloc(mem_size_for_cuda_arrays);
    double* exc = (double*)malloc(mem_size_for_cuda_arrays);
    double* v2rho2 = (double*)malloc(mem_size_for_cuda_arrays);
    double* v2rhosigma = (double*)malloc(mem_size_for_cuda_arrays);
    double* v2sigma2 = (double*)malloc(mem_size_for_cuda_arrays);

    memset(vrho, 0, mem_size_for_cuda_arrays);
    memset(vsigma, 0, mem_size_for_cuda_arrays);
    memset(exc, 0, mem_size_for_cuda_arrays);
    memset(v2rho2, 0, mem_size_for_cuda_arrays);
    memset(v2rhosigma, 0, mem_size_for_cuda_arrays);
    memset(v2sigma2, 0, mem_size_for_cuda_arrays);

    // Alloc for GPU params
    double *rhoCUDA = NULL;
    cudaMalloc((void **)&rhoCUDA, mem_size_for_cuda_arrays);
    cudaMemcpy(rhoCUDA, rho, mem_size_for_cuda_arrays, cudaMemcpyHostToDevice);

    double *sigmaCUDA = NULL;
    cudaMalloc((void **)&sigmaCUDA, mem_size_for_cuda_arrays);
    cudaMemcpy(sigmaCUDA, sigma, mem_size_for_cuda_arrays, cudaMemcpyHostToDevice);

    // Los siguientes pueden ser opcionales
    // asi que preguntamos si son != de NULL
    double *excCUDA = NULL;
    cudaMalloc((void **)&excCUDA, mem_size_for_cuda_arrays);
    cudaMemset(excCUDA, 0, mem_size_for_cuda_arrays);

    double *vrhoCUDA = NULL;
    cudaMalloc((void **)&vrhoCUDA, mem_size_for_cuda_arrays);
    cudaMemset(vrhoCUDA, 0, mem_size_for_cuda_arrays);

    double *vsigmaCUDA = NULL;
    cudaMalloc((void **)&vsigmaCUDA, mem_size_for_cuda_arrays);
    cudaMemset(vsigmaCUDA, 0, mem_size_for_cuda_arrays);

    double *v2rho2CUDA = NULL;
    cudaMalloc((void **)&v2rho2CUDA, mem_size_for_cuda_arrays);
    cudaMemset(v2rho2CUDA, 0, mem_size_for_cuda_arrays);

    double *v2rhosigmaCUDA = NULL;
    cudaMalloc((void**)&v2rhosigmaCUDA, mem_size_for_cuda_arrays);
    cudaMemset(v2rhosigmaCUDA, 0, mem_size_for_cuda_arrays);

    double *v2sigma2CUDA = NULL;
    cudaMalloc((void**)&v2sigma2CUDA, mem_size_for_cuda_arrays);
    cudaMemset(v2sigma2CUDA, 0, mem_size_for_cuda_arrays);

    xc_gga(&funcInternal, number_of_points, rhoCUDA, sigmaCUDA, excCUDA, vrhoCUDA, vsigmaCUDA, 
	v2rho2CUDA, v2rhosigmaCUDA, v2sigma2CUDA, NULL, NULL, NULL, NULL);

    //xc_gga(&funcInternal, number_of_points, rho, sigma, exc, vrho, vsigma, 
//	v2rho2, v2rhosigma, v2sigma2, NULL, NULL, NULL, NULL);

    // Copiamos de vuelta lo que dejo en los arrays.
    cudaMemcpy(exc, excCUDA, mem_size_for_cuda_arrays, cudaMemcpyDeviceToHost);
    cudaMemcpy(vrho, vrhoCUDA, mem_size_for_cuda_arrays, cudaMemcpyDeviceToHost);
    cudaMemcpy(vsigma, vsigmaCUDA, mem_size_for_cuda_arrays, cudaMemcpyDeviceToHost);
    cudaMemcpy(v2rho2, v2rho2CUDA, mem_size_for_cuda_arrays, cudaMemcpyDeviceToHost);
    cudaMemcpy(v2rhosigma, v2rhosigmaCUDA, mem_size_for_cuda_arrays, cudaMemcpyDeviceToHost);
    cudaMemcpy(v2sigma2, v2sigma2CUDA, mem_size_for_cuda_arrays, cudaMemcpyDeviceToHost);

    // Show the results
//    printf("===== output  ==== exc vrho vsigma v2rho2 v2rhosigma v2sigma2\n");
//    for(int j=0; j<number_of_points; j++) {
//	printf("=== doGGA %i %i  === %lf %lf %lf %lf %lf %lf \n", number_of_points, j,
//	exc[j], vrho[j], vsigma[j],
//	v2rho2[j], v2rhosigma[j], v2sigma2[j]);
//    }

    xc_func_end(&funcInternal);

    // Free the memory
    // For CPU
    free(exc);
    free(vrho);
    free(vsigma);
    free(v2rho2);
    free(v2rhosigma);
    free(v2sigma2);

    // For CUDA
    cudaFree(excCUDA);
    cudaFree(rhoCUDA);
    cudaFree(sigmaCUDA);
    cudaFree(vrhoCUDA);
    cudaFree(vsigmaCUDA);
    cudaFree(v2rho2CUDA);
    cudaFree(v2rhosigmaCUDA);
    cudaFree(v2sigma2CUDA);

}


